import React from 'react';
import './ComponenteState.css'


function ComponenteState() {
    let elementos = ['opcion1','opcion2', 'opcion3'];
    return(
        <div>
            <h2>Componente Eventos</h2>
            <ul>
                {elementos.map((item))}
            </ul>
        </div>
    );
}
export default ComponenteState;
